import React from 'react';
import { Container, Columns, Card } from 'react-bulma-components';

function Portfolio() {
  return (
    <section className="my-5 box">
      <h1 id="portfolio">Portfolio</h1>
      <div className="my-2">
        <Container>
          <Columns>
            <Columns.Column>1</Columns.Column>
            <Columns.Column>2</Columns.Column>
            <Columns.Column>3</Columns.Column>
            <Columns.Column>4</Columns.Column>
          </Columns>
        </Container>
      </div>
    </section>
  );
}

export default Portfolio;
